# 전치 후, 한 행씩 읽는게 더 빠르긴 하겠다.

def test_table():
    size = int(input())

    # Table Setting
    Table = []
    for row in range(size):
        oneLine = list(map(int, input().split()))
        Table.append(oneLine)
    
    SearchingTable = [0 for _ in range(size)]
    Deadlock = 0
    for row in range(size):
        for column in range(size):
            # 하강해야하는 자성체 발견 및 미탐색 cell인 경우 동작
            if Table[row][column] == 1 and SearchingTable[column] <= row:
                # 해당 column 전체 검색
                findDeadlock = False
                for search in range(row + 1, size):
                    # Deadlock 발생
                    if Table[search][column] == 2:
                        findDeadlock = True
                        SearchingTable[column] = search
                    elif Table[search][column] == 1:
                        SearchingTable[column] = search
                        break
                # 또 다른 하강해야하는 자성체 미발견
                else:
                    SearchingTable[column] = 100
                    pass
                
                if findDeadlock:
                    Deadlock += 1
    
    return Deadlock

    
    


for i in range(10):
    Deadlock = test_table()

    print(f"#{i+1} {Deadlock}")


